      "oh_my_jesus_6": "O my Jesus, forgive us our sins. Save us from the fires of hell. Lead all souls into heaven, especially those in most need of thy mercy. Amen.",
      "holy_queen": "Hail, holy Queen, mother of mercy,\\r\\nour life, our sweetness, and our hope.\\r\\nTo you we cry, poor banished children of Eve;\\r\\nto you we send up our sighs,\\r\\nmourning and weeping in this valley of tears.\\r\\nTurn, then, most gracious advocate,\\r\\nyour eyes of mercy toward us;\\r\\nand after this, our exile,\\r\\nshow unto us the blessed fruit of your womb, Jesus.\\r\\nO clement, O loving, O sweet Virgin Mary.",
      "final_prayer": "O God, whose only begotten Son, by His life, death, and resurrection, has purchased for us the rewards of eternal life, grant, we beseech Thee, that meditating upon these mysteries of the Most Holy Rosary of the Blessed Virgin Mary, we may imitate what they contain and obtain what they promise, through the same Christ Our Lord. Amen.",
      "in_the_name_2": "In the name of the Father, and of the\\nSon, and of the Holy Spirit. Amen."
